import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the featured products grid to appear
    await page.waitForSelector('#productsGrid', { timeout: 5000 });

    // Find the first product card in the featured products grid
    const productCardSelector = '#productsGrid .product-card';
    await page.waitForSelector(productCardSelector, { timeout: 5000 });

    // Click the first product card to open the product detail modal
    const productCards = await page.$$(productCardSelector);
    if (productCards.length === 0) throw new Error('No product cards found');
    await productCards[0].click();

    // Wait for the product detail modal to appear
    const modalSelector = '#productModal';
    await page.waitForSelector(modalSelector, { timeout: 5000 });

    // Wait for the "Add to Wish List" button in the modal
    const addToWishlistSelector = 'button.add-to-wishlist';
    await page.waitForSelector(addToWishlistSelector, { timeout: 5000 });

    // Take screenshot before adding to wishlist
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_modal_open.png'));

    // Click the "Add to Wish List" button
    await page.click(addToWishlistSelector);

    // Wait for the notification to appear
    const notificationSelector = '.notification.success';
    await page.waitForSelector(notificationSelector, { timeout: 5000 });

    // Take screenshot after adding to wishlist
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_added_to_wishlist.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_added_to_wishlist.png'));

    // Close the modal (click the close button)
    const closeBtnSelector = '#productModal .close';
    await page.waitForSelector(closeBtnSelector, { timeout: 5000 });
    await page.click(closeBtnSelector);

    // Go to the wishlist page (simulate click on "Your Wish List" link)
    // Try to find the first visible "Your Wish List" link
    const wishListLink = await page.$x("//a[contains(text(), 'Your Wish List')]");
    if (wishListLink.length > 0) {
      await wishListLink[0].click();
    } else {
      throw new Error('Could not find "Your Wish List" link');
    }

    // Wait for the wishlist page to load
    await page.waitForSelector('.wishlist-page', { timeout: 5000 });

    // Take screenshot of the wishlist page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_wishlist_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_wishlist_page.png'));

    // Extract the first wishlist item title for verification
    const wishlistItemTitleSelector = '.wishlist-item .wishlist-title';
    await page.waitForSelector(wishlistItemTitleSelector, { timeout: 5000 });
    const wishlistTitle = await page.$eval(wishlistItemTitleSelector, el => el.textContent.trim());

    return {
      success: true,
      action: "Added first featured product to wishlist and verified its presence in the wishlist page",
      extractedData: {
        wishlistFirstItemTitle: wishlistTitle
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
